import React, { Component } from 'react';
import rocketLogo from '../src/img/rocket-02.png';
import NavToggle from './NavToggle';
export default class Abovefold extends Component {
  render() {
    return (
      <div> 
      <div className="aboveFold">
      <h1>Prepare for the launch of the Rocket</h1>

      <div className="logo">
      <img className="rocketLogo" src={rocketLogo} alt="rocket logo"/>
      </div>
      <div className="cta">
      <button className="btn">Our story</button>
      <button className="btn">The Fleece</button>
      </div>
      </div>
      <NavToggle click={this.menuToggleHandler}/>
      </div>
    )
  }
}
